import React from 'react';
import './profile.css';

const ProfileScreen = () => {
  // Replace these with your actual profile data
  const profileData = {
    name: 'John Doe',
    bio: 'Frontend Developer | UI/UX Enthusiast',
    profileImage: 'https://example.com/profile-image.jpg',
    coverImage: 'https://example.com/cover-image.jpg',
    badges: ['React Master', 'JavaScript Ninja', 'UI Wizard'],
    xp: 3500,
    sessionsAttended: 42,
    title: 'The Merge Master',
  };

  return (
    <div className="profile-screen">
      <div className="cover-image">
        <img src={profileData.coverImage} alt="Cover" />
      </div>
      <div className="profile-content">
        <div className="profile-image">
          <img src={profileData.profileImage} alt="Profile" />
        </div>
        <div className="profile-info">
          <h1>{profileData.name}</h1>
          <p>{profileData.bio}</p>
          <div className="badges">
            {profileData.badges.map((badge) => (
              <span key={badge} className="badge">
                {badge}
              </span>
            ))}
          </div>
          <div className="xp-sessions">
            <p>
              <strong>XP:</strong> {profileData.xp}
            </p>
            <p>
              <strong>Sessions Attended:</strong> {profileData.sessionsAttended}
            </p>
          </div>
          <div className="title">{profileData.title}</div>
        </div>
      </div>
    </div>
  );
};

export default ProfileScreen;
